    inputDesc: ItodoList;
    removeTodo(TodoNameDelete: string): void;
}

export const InputTodo = ({ inputDesc, removeTodo}: Props) => {
    return (
        <div>
          <div>
            <span>{inputDesc.todoName}</span>
            <span>{inputDesc.category}</span>
            <span>{inputDesc.content}</span>
          </div>
          <button
            onClick={() => {
              removeTodo(inputDesc.todoName);
            }}
          >
            X
          </button>
        </div>
    );
};


